import React, {useState} from 'react';

function Acceuil(props) {
  const [welcome, setWelcome] = useState(""); 
  console.log(props?.role);
  if(props?.role === 1) {
    setWelcome("Welcome admin")
  } else if(props?.role === 2) {
    setWelcome("Welcome guichet droit arabe")
  } if(props?.role === 3) {
    setWelcome("Welcome guichet droit francais")
  } else if(props?.role === 4) {
    setWelcome("Welcome guichet economie")
  } if(props?.role === 5) {
    setWelcome("Welcome service de diplomes")
  } else if(props?.role === 6) {
    setWelcome("Welcome decanat")
  } if(props?.role === 7) {
    setWelcome("Welcome bureau d'ordre")
  } else if(props?.role === 8) {
    setWelcome("Welcome guichet de retrait")
  }
  return (
    <div className="container" style={{ minWidth: "100%", maxHeight: "100%" }}>
      <div className="row">
        <div className="col-12">
        <h1>{welcome}</h1>
        </div>
      </div>
    </div>
  );
}

export default Acceuil;
